function AnonsForm() {
    return (  
        <>
            <a href="">
                <div class="preview-block">
                <img src="./img/anons.jpg" alt="" className="preview-img" />
                <p class="preview-name">Анонс нового сезона Семь смерных грехов</p>
            </div>
        </a>
        </>
    );
}

export default AnonsForm;
